import React from "react";
import './Login.scss'
const Log = () => {
  return (
    <form className="test" onSubmit={login}>
    <h1>Create Account</h1>
    
    
    <label>
      Email:
      <input
        name="email"
        type="email"
        value={email}
        onChange={e => setEmail(e.target.value)}
        required />
    </label>

    <label>
      Password:
      <input
        name="password"
        type="password"
        value={password}
        onChange={e => setPassword(e.target.value)}
        required />
    </label>


    <button>Submit</button>
    <p>Erreur</p>
  </form>
  
  );

  
};

export default Log;
